import React, { } from 'react';
import {
  Link,
  useHistory
} from "react-router-dom";

function App() {

  return (

    <div className="App">
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">ContentData</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/users">Users</Link>
            </li>
          </ul>
        </nav>


      </div>
    </div>

  );
}


function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Users() {
  return
  <h2>Users</h2>;
}

export default App;
